import{_ as e,o as r,c as t,O as a}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 59.1-505.6 Transfer by licensee.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/59.1-505.6.md","filePath":"vacode/59.1-505.6.md"}'),n={name:"vacode/59.1-505.6.md"},i=a('<h1 id="§-59-1-505-6-transfer-by-licensee" tabindex="-1">§ 59.1-505.6 Transfer by licensee. <a class="header-anchor" href="#§-59-1-505-6-transfer-by-licensee" aria-label="Permalink to &quot;§ 59.1-505.6 Transfer by licensee.&quot;">​</a></h1><p>(a) If all or any part of a licensee&#39;s interest in a license is transferred, voluntarily or involuntarily, the transferee does not acquire an interest in information, copies, or the contractual or informational rights of the licensee unless the transfer is effective under § <a href="http://law.lis.virginia.gov/vacode/59.1-505.3/" target="_blank" rel="noreferrer">59.1-505.3</a> or § <a href="http://law.lis.virginia.gov/vacode/59.1-505.8/" target="_blank" rel="noreferrer">59.1-505.8</a> (a) (1) (B). If the transfer is effective, the transferee takes subject to the terms of the license.</p><p>(b) Except as otherwise provided under trade secret law, a transferee acquires no more than the contractual interest or other rights that the transferor was authorized to transfer.</p><p>2000, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0101" target="_blank" rel="noreferrer">101</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0996" target="_blank" rel="noreferrer">996</a>.</p>',4),s=[i];function o(c,l,f,h,_,d){return r(),t("div",null,s)}const v=e(n,[["render",o]]);export{u as __pageData,v as default};
